  `menu_code` varchar(255) NOT NULL DEFAULT '' COMMENT '菜单代码',
  `menu_type` int(11) NOT NULL DEFAULT '1' COMMENT '菜单类型 0-分类导航 1-菜单页面 2-查询类按钮 3-操作类按钮',
