  `num` int(11) NOT NULL DEFAULT '0' COMMENT '排序号',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态 -1-已删除，0-不可删除，1-可删除，2-冻结，3-不推荐使用',
